<?php
require_once ('../.././../autoload_standalone.php');
use GlobalPayments\Api\Builders\HPPBuilder;
use GlobalPayments\Api\ServiceConfigs\Gateways\GpApiConfig;
use GlobalPayments\Api\ServicesContainer;
use GlobalPayments\Api\Entities\Enums\Environment;
use GlobalPayments\Api\Entities\Enums\Channel;
use GlobalPayments\Api\Entities\PayerDetails;
use GlobalPayments\Api\Entities\Enums\CaptureMode;
use GlobalPayments\Api\Entities\Enums\ChallengeRequestIndicator;
use GlobalPayments\Api\Services\HPPService;
use GlobalPayments\Api\Entities\Enums\PaymentMethodUsageMode;
use GlobalPayments\Api\Entities\Enums\HPPStorageModes;
use GlobalPayments\Api\Entities\Address;
use GlobalPayments\Api\Entities\Enums\AddressType;
use GlobalPayments\Api\Entities\PhoneNumber;
use GlobalPayments\Api\Entities\Enums\PhoneNumberType;
use GlobalPayments\Api\Entities\Enums\PayByLinkType;
use GlobalPayments\Api\Entities\Enums\HPPTypes;
use GlobalPayments\Api\Entities\Enums\HPPFunctions;
use GlobalPayments\Api\Entities\Enums\ExemptStatus;
use GlobalPayments\Api\Entities\Enums\HPPAllowedPaymentMethods;
use GlobalPayments\Api\Builders\Enums\HPPDisplayConfiguration;

//This Demo page URL
$demo_page_url = "https://".$_SERVER['HTTP_HOST'] . $_SERVER['REQUEST_URI'];

// Configuration for the GPApiConfig
$config = new GpApiConfig();
 //Takepayments app ID and key
$config->appId = 'YOUR_APP_ID';
$config->appKey = 'YOUR_APP_KEY';
$config->environment = Environment::TEST;
$config->country = 'GB';
$config->channel = Channel::CardNotPresent;

ServicesContainer::configureService($config);

//Crating a new Payer
$example_payer = new PayerDetails();
$example_payer->firstName = 'Nicolas';
$example_payer->lastName = 'Cage';
$example_payer->name = 'Nicolas Cage';
$example_payer->email = 'nicolas.cage@takepayments.com';
//If the payer is new, the payer status should be NEW. If the payer has a payer ID,the status should be 'ACTIVE', and 
//the payer ID should be set in the payer->id property. 
$example_payer->status = 'NEW';  

$example_payer->mobilePhone = new PhoneNumber("44", "01606 566600", PhoneNumberType::MOBILE);
//shipping Phone is requied for 3DS 
$example_payer->shippingPhone = new PhoneNumber("44", "01606 566600", PhoneNumberType::SHIPPING);
// Full billing address is also required for 3DS
$example_payer->billingAddress = new Address();
$example_payer->billingAddress->streetAddress1 = 'Takepayments, Highbank House';
$example_payer->billingAddress->streetAddress2 = '2275 Exchange Street';
$example_payer->billingAddress->streetAddress3 = 'Unit 1';
$example_payer->billingAddress->city = 'Stockport';
//Important for UK, state must be in in ISO 3166-2 format. Example: Manchester is MAN
$example_payer->billingAddress->state = 'MAN';
$example_payer->billingAddress->postalCode = 'SK3 0ET';
//Important for UK, country must be in ISO 3166-1 alpha-2 format. Example: United Kingdom is GB
$example_payer->billingAddress->country = 'GB'; 
// ISO 3166-1 numeric code for United Kingdom
$example_payer->billingAddress->countryCode =  "GB";

$example_payer->shippingAddress = new Address();
$example_payer->shippingAddress->streetAddress1 = 'Takepayments, Highbank House';
$example_payer->shippingAddress->streetAddress2 = '2275 Exchange Street';
$example_payer->shippingAddress->city = 'Stockport';
//Important for UK, state must be in in ISO 3166-2 format. Example: Manchester is MAN
$example_payer->shippingAddress->state = 'MAN'; 
$example_payer->shippingAddress->postalCode = 'SK3 0ET';
//Important for UK, country must be in ISO 3166-1 alpha-2 format. Example: United Kingdom is GB
$example_payer->shippingAddress->country = 'GB'; 
// ISO 3166-1 numeric code for United Kingdom
$example_payer->shippingAddress->countryCode =  "GB"; 

echo "<h1>GP-API Hosted Payment Pages Examples</h1>";
// Create a Hosted Payment Page
try{
	$first_example = HPPBuilder::create()
	// The withName method sets the display name of the payment page
	->withName('Example 1')
	// Declarative description of the payment, shown on realcontroll
	->withDescription("Payment for singular sock")
	// Important: It's not written in the documentation but the reference cannot start with a number
	->withReference("singular_sock_payment_" . uniqid())
	// Amount in smallest common denominator (pence for GBP)
    ->withAmount("10000") 
	->withPayer($example_payer)
	
	/* Notifications configuration
	// - returnUrl: Where customer is redirected after completing payment. This should create a form with the tranaction data and POST to the final page
	// - statusUrl: Where payment status updates are sent via POST -- Still under development
	// - cancelUrl: Where customer is redirected if they cancel the payment -- Still under development
	*/
	->withNotifications(
		$demo_page_url . "return_url.php",
		$demo_page_url . "status_url.php",
		$demo_page_url . "cancel_url.php"
	)
	->withBillingAddress($example_payer->billingAddress)
	->withShippingAddress($example_payer->shippingAddress)
    //Indicates whether the shipping address matches the billing address
	->withAddressMatchIndicator(true)
	->withShippingPhone($example_payer->shippingPhone)
	->withCurrency('GBP') // Set currency to GBP
	
    /* Transaction configuration
    *  - channel: The payment channel (e.g. CardNotPresent)
    *  - country: The country code (e.g. 'GB')
    *  - captureMode: Indicates whether the transaction is to be captured automatically, or later after a separate request. Can be set to Multiple to accommodate subscriptions
    *  - allowedPaymentMethods: An array of allowed payment methods. E.G: [HPPAllowedPaymentMethods::CARD, HPPAllowedPaymentMethods::BANK_PAYMENT],HPPAllowedPaymentMethods::BLIK )
    *  - usageMode: Sets the HPP URL to Multiple or single uses
    *  - usageLimit: The maximum number of times the HPP URL can be used
    */

	->withTransactionConfig(Channel::CardNotPresent, 'GB', CaptureMode::AUTO)
	
	// Authentication configuration for 3DS
	// ChallengeRequestIndicator - Indicates the merchants preference for 3DS checks
	// ExemptStatus - indicates potential exemption from 3DS, currently the only exemption is LOW_VALUE
	// BillingAddressRequired - whether 3DS checks should be performed on the supplied billing address
	->withAuthentication(
		ChallengeRequestIndicator::CHALLENGE_PREFERRED,
		ExemptStatus::LOW_VALUE,
		true
	)
	//Indicates if you want to capture the customers shipping information on the hosted payment page.
    // second parameter sets a shipping fee
	->withShipping(true, "999")
    //Digital wallets, applepay will only show on apple devices
    ->withDigitalWallets(["googlepay", "applepay"])
    // Generate The HPP URL
	->execute();
	echo "<h2>Hosted Payment Page Created</h2>";
	echo '<a target="_blank" href="'.$first_example->payByLinkResponse->url.'">Click here to pay</a>';
	// echo "<pre>" . print_r($first_example->payByLinkResponse, true) . "</pre>";

	// echo "<h2>Loaded in Iframe</h2>";

	// echo '<iframe src="'.$first_example->payByLinkResponse->url.'" width="100%" height="600px"></iframe>';
	// echo "<pre>" . print_r($first_example->payByLinkResponse, true) . "</pre>";
}catch (\Exception $e) {
	echo "Error creating hosted payment page: " . $e->getMessage();
	echo "<pre>" . print_r($e->getTrace(), true) . "</pre>";
	exit;
}

