$second_example_payer->email = 'nicolas.cage@takepayments.com';
$second_example_payer->status = 'ACTIVE'; 
//Active payer ID, supplied by the gateway from a previous payer request
$second_example_payer->id = "PYR_385be203a4c84006a3c3ad896dfaa360";
$second_example_payer->mobilePhone = new PhoneNumber("44", "01606 566600", PhoneNumberType::MOBILE);
$second_example_payer->shippingPhone = new PhoneNumber("44", "01606 566600", PhoneNumberType::SHIPPING);
$second_example_payer->billingAddress = new Address();
$second_example_payer->billingAddress->streetAddress1 = 'Takepayments, Highbank House';
$second_example_payer->billingAddress->streetAddress2 = '2275 Exchange Street';
$second_example_payer->billingAddress->streetAddress3 = 'Unit 1';
