	echo "<pre>" . print_r($e->getTrace(), true) . "</pre>";
}
// Third example using ALL available HostedPayment methods 
try {
    // Create a payer
    $third_example_payer = new PayerDetails();
    $third_example_payer->firstName = 'Nicolas';
    $third_example_payer->lastName = 'Cage';
    $third_example_payer->name = 'Nicolas Cage';
    $third_example_payer->email = 'nicolas.cage@example.com';
    $third_example_payer->status = 'NEW';
    $third_example_payer->language = 'en';
    $third_example_payer->mobilePhone = new PhoneNumber("44", "07987654321", PhoneNumberType::MOBILE);
    
    // Set up billing address
    $third_example_payer->billingAddress = new Address();
    $third_example_payer->billingAddress->streetAddress1 = '456 Main Street';
    $third_example_payer->billingAddress->streetAddress2 = 'Unit 789';
    $third_example_payer->billingAddress->city = 'Cambridge';
    $third_example_payer->billingAddress->state = 'CAM';
    $third_example_payer->billingAddress->postalCode = 'CB1 2XY';
    $third_example_payer->billingAddress->country = 'GB';
    $third_example_payer->billingAddress->countryCode = "GB";

	// Set up shipping address
    $third_example_payer->shippingAddress = new Address();
    $third_example_payer->shippingAddress->streetAddress1 = '456 Main Street';
    $third_example_payer->shippingAddress->streetAddress2 = 'Unit 789';
    $third_example_payer->shippingAddress->city = 'Cambridge';
    $third_example_payer->shippingAddress->state = 'CAM';
    $third_example_payer->shippingAddress->postalCode = 'CB1 2XY';
    $third_example_payer->shippingAddress->country = 'GB';
    $third_example_payer->shippingAddress->countryCode = "GB";
    
    // Create the HostedPayment builder
    $builder = HPPBuilder::create();
    
    // Build the third example with ALL available HostedPayment methods
    $third_example = $builder
        
        ->withName('HPP All Methods')
        ->withDescription("Comprehensive demonstration of all HostedPayment methods")
        ->withReference(uniqid() . "_comprehensive_example")
        ->withAmount("20000") // Â£200.00 in pence
        ->withCurrency('GBP')

        // Indicates the type of hosted form resorce, HOSTED_PAYMENT_PAGE is the default, but all posable options are:
        // THIRD_PARTY_PAGE, PAYMENT, THIRD_PARTY_PAGE or EXCHANGE_APP_CREDENTIALS
        ->withType(HPPTypes::HOSTED_PAYMENT_PAGE)

        /*Describes the function the HPP link created can have
        
        DEPOSIT_REPORT- is a merchant report that will display all transactions in a Global Payments automated sweep.
        UPDATE_PRIMARY_ACCOUNT is a page that allows a merchant to update the primary payout bank information on an account.
        CONFIRM_VALIDATION_DEPOSITS is a page that allows a merchant to validate the micro deposits that have been dposited to the primary payout payment method on file.
        SEND_VALIDATION_DEPOSITS is a page that allows a merchant to trigger 2 micro deposits to the primary bank account on file to validate the bank account.
        UPDATE_PAYOUT_CARD is a page that allows a merchant to update the payout card on file.
        FUND_PAYOUT_CARD is a page that allows a merchant to initiate a payout to the payout card on file.
        FUND_PRIMARY_PAYOUT is a page that allows a merchant to initiate a payout to the primary payout payment method on file.
        FMA_TRANSFER is a page that allows a merchant to send funds to another merchant.
        CREDIT_FMA is a page that allows a merchant to pull funds from a bank account into the funds management account.
        SCHEDULED_FUND is a page that allows a merchant to schedule a funds payout to their primary payout payment method on file.
        UPDATE_BUSINESS_INFORMATION is a page that allows a merchant to update the business information associated on their merchant account.
        UPDATE_ADDRESS_PHONE is a page that allows a merchant to update the phone and addresses associated with a merchant account.
        UPDATE_PIN is a page that allows a merchant to update the pin to access the IVR line for their merchant account.
        UPDATE_EMAIL is a page that allows a merchant to update the primary email address associated with a merchant account.
        PREPAID_CARD_INDEX is a page that allows a merchant to view information about their prepaid debit card linked to their merchant account balance.
        REQUEST_PREPAID_CARD is a page that allows a merchant to agree to terms and conditions and request a prepaid debit card linked to the balance in a merchant account.
        ACTIVATE_PREPAID_CARD is a page that allows a merchant to activate a prepaid debit card linked to the balance in their merchant account.
        LOST_PREPAID_CARD is a page that allows a merchant to mark the prepaid debit card linked to their merchant balance lost or stolen.
        UPDATE_PREPAID_CARD_PIN is a page that allows a merchant to update the 4 digit pin associated with the prepaid debit card to access funds in the merchant account.
        REISSUE_PREPAID_CARD is a page that allows a merchant to request an updated prepaid debit card to access the funds in the merchant account.
        UPDATE_PAYMENT_METHOD is a page that allows a merchant to edit/update the account activation fee payment method on file.
        DOCUMENT_UPLOAD is a page that will allow a merchant upload documents related to merchant identity validation, underwriting and risk review.
        CHARGEBACK_REPORT is a page that will display all active disputed transactions and allow document uploads to respond to the listed disputes for a merchant.
        ADVANCED_TRANSACTION_SEARCH is a page that allows a user to set criteria and generate a report.
        CONSOLIDATED_FEES is a page that will show the consolidated fees for a merchant within ane stablished timeframe.
        LIMITS_RATES_FEES is a page that displays the processing limits and processing fees on a merchant account.
        TRANSACTION_REPORT is a page that allows a user to view all transactions within an established timeframe.
        GB_FEES_REPORT is a page that allows a merchant to review fees they will be charged, as is required by PSR (Payment Systems Regulator).
            */
        // ->withFunction(HPPFunctions::PAYMENT_PROCESSING)
        
        
        // Payer information
        ->withPayer(
            $third_example_payer 
        )
        // Billing address
        ->withBillingAddress(
            $third_example_payer->billingAddress
           
        )
        // shipping address
        ->withShippingAddress(
            $third_example_payer->shippingAddress
        )
        // Address match indicator
        ->withAddressMatchIndicator(true)
        // Shipping phone 
        ->withShippingPhone($third_example_payer->mobilePhone) // Using mobile phone as shipping phone
         // Callback notifications
        ->withNotifications(
			$demo_page_url . "return_url.php", // Return URL
			$demo_page_url . "status_url.php", // Status URL
			$demo_page_url . "cancel_url.php" // Cancel URL
        )
        //Callbacks for the Iframe callbacks
        ->withHPPDisplayConfiguration(
			$demo_page_url . "iframe_callback.php", // Status URL
			$demo_page_url . "iframe_callback.php" // Status URL
        )
        
        // The url of the page requesting the page.
        ->withReferrerUrl($demo_page_url . "index.php")
        
        // The ip address of the page that will host the third-party page.
        // ->withIpAddress($_SERVER['SERVER_ADDR'] ?? '127.0.0.1')
        
        // Transaction configuration
        ->withTransactionConfig(
            Channel::CardNotPresent,
            'GB',
            CaptureMode::AUTO,
            [HPPAllowedPaymentMethods::CARD], //enum for allowed payment methods, possible values: CARD, BANK_PAYMENT, BLIK
            PaymentMethodUsageMode::SINGLE //Times this Hosted Payment Page can be used, possible values: SINGLE, MULTIPLE
        )
        
        // Currency conversion mode
        ->withCurrencyConversionMode(true) // Either true or false

        // Authentication settings, please see first example for more information
        ->withAuthentication(
            ChallengeRequestIndicator::CHALLENGE_PREFERRED,
            ExemptStatus::LOW_VALUE,
            true
        )
        
        // Shipping configuration, adds a shipping charge
        ->withShipping(true, "750")
        
        
        // Set expiration date for the payment link
        ->withExpirationDate(date('Y-m-d\TH:i:s\Z', strtotime('+30 days')))
                
        // Add an image to the hosted payment page (base64 encoded)
        ->withImage(getB64Image())
        
        // Set payer phone 
        ->withPayerPhone($third_example_payer->mobilePhone)
        
        // Set order reference (separate from main reference)
        ->withOrderReference("ORDER_REF_" . uniqid())
        
        // Configure payment method settings with card storage mode
        ->withPaymentMethodConfig(HPPStorageModes::PROMPT)
        
        // Configure APM settings, these are PayPal specific
        ->withApm(true, false) // shipping address enabled, address override disabled

        // When EXCHANGE_APP_CREDENTIALS function is set, this email address will receive the app credentials
        ->withAppEmail("developer@takepayments.com")
        //Indicates the apps you want the credentials for. Credentials will be sent to the requested app_email.
        ->withAppIds(["app_id_1", "app_id_2"])
        // Build the HPP URL
        ->execute();
        
    echo "<h2>Third Example - Using all HPP Methods</h2>";
    echo '<a target="_blank" href="'.$third_example->payByLinkResponse->url.'">Click here to pay (HPP All Methods)</a>';
    // echo "<pre>" . print_r($third_example->payByLinkResponse, true) . "</pre>";
    
    // echo "<h2>Third example loaded in Iframe (with display configuration)</h2>";
    // echo '<iframe src="'.$third_example->payByLinkResponse->url.'" width="100%" height="700px"></iframe>';
    
} catch (\Exception $e) {
    echo "Error creating comprehensive hosted payment page example: " . $e->getMessage();
    echo "<pre>" . print_r($e->getTrace(), true) . "</pre>";
}

function getB64Image() : string {
	// Added to the bottom of the file for readablity. 
	// This is taken from the HPP documentation, its a picture of pizza. 
	// Please note, included within this demo to show all the methods available in the Hosted Payment Page,
	// but It doesn't seem to render on the HPP page.
	return '';
}